import React from 'react'
import { TextField } from '@material-ui/core'

export default function Resp({ resp }) {
  return (
    <>
      <TextField
        id="standard-read-only-input"
        label="Read Only"
        defaultValue={ resp }
        InputProps={{
          readOnly: true,
        }}
      />
      <br />
    </>
  )
}
